	private static int getValue(int... bits) {
		int value = 0;
		int multiplier = 1;
		for (int i = 0; i < bits.length; i++) {
			value = value + bits[i] * multiplier;
			multiplier = multiplier * 2;
		}
		return value;
	}
	
